--funkcja, ktora po podaniu numeru id pokazuje imie i nazwisko sportowca, jego wiek, sport ktory uprawia oraz druzyne, w ktorej gra.
CREATE OR REPLACE FUNCTION znajdz_sportowca(id int)
RETURNS record
AS
$$
DECLARE
	imie_f Varchar;
	nazwisko_f Varchar;
	wiek_f Integer;
	sport_f Varchar;
	druzyna_f Varchar;
BEGIN
	SELECT imie
	INTO imie_f 
	FROM Sportowcy 
	WHERE id_sportowca = id;
	
	SELECT nazwisko
	INTO nazwisko_f 
	FROM Sportowcy
	WHERE id_sportowca = id;
	
	SELECT wiek
	INTO wiek_f 
	FROM Sportowcy
	WHERE id_sportowca = id;
	
	SELECT nazwa 
	INTO sport_f
	FROM Dyscypliny_sportowe 
	WHERE id_sportu = 
		(SELECT sport FROM Sportowcy WHERE id_sportowca = id); 

	SELECT nazwa
	INTO druzyna_f
	FROM Druzyny	
	WHERE id_druzyny = 
		(SELECT druzyna FROM Sportowcy WHERE id_sportowca = id);
	
	RETURN (imie_f, nazwisko_f, wiek_f, sport_f, druzyna_f);
	
END
$$ LANGUAGE plpgsql;

